import { useDispatch } from "react-redux";
import { deleteBuild } from "../redux/actions/post_action";

function CurrentBuildCard({ el }) {
  const dispatch = useDispatch();
  console.log(el);
  return (
    <main>
      <div>
        <div className='buildCardItem'>
          {/*begin of image map here */}
          <div>
            {el.photos.map((el) =>
              el.backgroundimage.map((el) => <img src={el.path} className='buildCardImage' alt='' />)
            )}

            <div className='buildCardItemInfo'>
              <li className='buildCardItemLI'>{el.buildname}</li>
              <ul>
                <li className='buildCardItemLI'></li>
                <li className='buildCardItemLI'></li>
              </ul>
            </div>
            {/*end of image */}
          </div>
        </div>
        {/* End of gallery */}
      </div>
      {/* End of container */}
      <a href='/editbuild' className='visually-hidden'>
        Edit
      </a>
      <button className='visually-hidden' onClick={() => dispatch(deleteBuild(el._id))}>
        Delete
      </button>
    </main>
  );
}

export default CurrentBuildCard;
